import './App.css';
import React , {useState} from 'react';
import img from './add.png'

function App() {
  let [item , setItem] = useState();
  const change = (value) =>{
    setItem(value.target.value)
  }
  return (
    <>
      <div className = "box">
        <div className='box1'>
          <h1>ToDo List</h1>
          <div className='input'>

            <input type='input' placeholder='Add an Item' onChange={change}></input>
            <button className='button'>+</button>
          </div>
          <ol>
            <li>{item}</li>
          </ol>
        </div>
      </div>
    </>
  );
}

export default App;
